eval("// Module\nvar code = \"<div class=\\\"note-title\\\"><p>惰性函数</p>\\n<p>惰性函数即函数执行后，原函数在函数内部被重新定义，之后调用只执行重新定义的函数，常用在内部状态稳定不变，即执行环境条件确定后，之后无论调用多少次函数，都返回同样结果或函数，此时可以使用惰性函数，直接重新定义函数。</p>\\n</div><div class=\\\"note-content\\\"><pre><code class=\\\"hljs js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">addEvent</span>(<span class=\\\"hljs-params\\\">type, element, fun</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">if</span> (element.addEventListener) {\\n    addEvent = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> (<span class=\\\"hljs-params\\\">type, element, fun</span>) </span>{\\n      element.addEventListener(type, fun, <span class=\\\"hljs-literal\\\">false</span>);\\n    }\\n  } <span class=\\\"hljs-keyword\\\">else</span> <span class=\\\"hljs-keyword\\\">if</span> (element.attachEvent) {\\n    addEvent = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> (<span class=\\\"hljs-params\\\">type, element, fun</span>) </span>{\\n      element.attachEvent(<span class=\\\"hljs-string\\\">'on'</span> + type, fun);\\n    }\\n  } <span class=\\\"hljs-keyword\\\">else</span> {\\n    addEvent = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> (<span class=\\\"hljs-params\\\">type, element, fun</span>) </span>{\\n      element[<span class=\\\"hljs-string\\\">'on'</span> + type] = fun;\\n    }\\n  }\\n  <span class=\\\"hljs-keyword\\\">return</span> addEvent(type, element, fun);\\n}</code></pre>\\n</div>\";\n// Exports\nmodule.exports = code;\n\n//# sourceURL=webpack:///./sources/javascript/%E6%83%B0%E6%80%A7%E5%87%BD%E6%95%B0.md?");

