eval("// Module\nvar code = \"<div class=\\\"note-title\\\"><p>执行上下文与变量提升</p>\\n<p>正确理解执行上下文和执行栈的概念将使您成为更出色的 JavaScript 开发者</p>\\n</div><div class=\\\"note-content\\\"><p><strong>一、函数执行上下文</strong></p>\\n<p>​    执行上下文又称执行环境，分全局执行环境与函数执行环境、eval三种，每个执行环境都包含三部分内容：</p>\\n<ul>\\n<li><p>变量对象/活动对象</p>\\n<p>(1) 变量对象(VO)中存储了在上下文（环境）中定义的变量和函数声明，声明提升是就是发生在创建变量对象的过程中。</p>\\n<p>(2) 活动对象：函数执行时产生    </p>\\n</li>\\n<li><p>作用域链</p>\\n<blockquote>\\n<p>闭包中的作用域链为静态作用域，指向所处函数上下文，因此闭包函数中访问外界变量时首先去所处函数环境中的变量对象中取对应的属性</p>\\n</blockquote>\\n</li>\\n<li><p>this</p>\\n</li>\\n</ul>\\n<p>参考链接：<a href=\\\"http://www.cnblogs.com/TomXu/archive/2012/01/12/2308594.html\\\">javas核心</a>、<a href=\\\"http://www.cnblogs.com/TomXu/archive/2012/01/13/2308101.html\\\">执行上下文</a>、<a href=\\\"http://www.cnblogs.com/TomXu/archive/2012/01/16/2309728.html\\\">变量对象</a>、<a href=\\\"http://www.cnblogs.com/TomXu/archive/2012/01/17/2310479.html\\\">this</a>、<a href=\\\"http://www.cnblogs.com/TomXu/archive/2012/01/18/2312463.html\\\">作用域链</a>、<a href=\\\"https://www.jb51.net/article/104875.htm\\\">尾调用</a></p>\\n<p><strong>二、从执行上下文与变量对象角度去分析JS变量提示与函数提升</strong></p>\\n<p>先看一个简单的例子</p>\\n<pre><code class=\\\"hljs js\\\"><span class=\\\"hljs-built_in\\\">console</span>.log(a);  <span class=\\\"hljs-comment\\\">// 输出a方法</span>\\n<span class=\\\"hljs-built_in\\\">console</span>.log(c);  <span class=\\\"hljs-comment\\\">// 输出undefined</span>\\n<span class=\\\"hljs-keyword\\\">var</span> c = a;\\n<span class=\\\"hljs-keyword\\\">var</span> a = <span class=\\\"hljs-number\\\">10</span>;\\n\\n<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">a</span>(<span class=\\\"hljs-params\\\">b</span>) </span>{\\n  <span class=\\\"hljs-built_in\\\">console</span>.log(b) <span class=\\\"hljs-comment\\\">// 输出b的形参值</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> b = <span class=\\\"hljs-number\\\">20</span>;\\n  <span class=\\\"hljs-built_in\\\">console</span>.log(b) <span class=\\\"hljs-comment\\\">// 输出20</span>\\n}\\n\\n<span class=\\\"hljs-built_in\\\">console</span>.log(a);  <span class=\\\"hljs-comment\\\">// 输出10</span>\\nc(<span class=\\\"hljs-number\\\">5</span>)</code></pre>\\n<p>分析：当代码执行时，首先形成全局执行上下文，而变量对象(VO)属于全局执行上下文的一部分，变量对象包括了：变量声明、函数声明(声明提升其实就是发生在变量对象定义过程中的)，在变量声明时若已存在相同名称的形参或函数，则变量声明不会干扰已存在的这类属性，也就是说变量对象中只存在相应的形参或函数声明，而同样名称变量声明不会再放入变量对象中，之后当代码执行到对应的变量赋值时，相当于为当前变量对象中已存在的函数声明或形参重新赋予新的值。</p>\\n<p>填充VO的顺序是: 函数的形参 -&gt; 函数申明 -&gt; 变量申明。 </p>\\n<pre><code class=\\\"hljs js\\\"><span class=\\\"hljs-comment\\\">// 伪代码：全局环境变量对象</span>\\nGlobal(VO) = {\\n    <span class=\\\"hljs-attr\\\">a</span>: <span class=\\\"xml\\\"><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">reference</span> <span class=\\\"hljs-attr\\\">to</span> <span class=\\\"hljs-attr\\\">FunctionDeclaration</span> \\\"<span class=\\\"hljs-attr\\\">d</span>\\\"&gt;</span>,\\n    c: undefined,\\n}\\n// 伪代码：函数a执行环境中的活动对象(在函数执行上下文，VO不能直接访问，所以实际上由活动对象(AO)代替VO)\\n// VO是创建阶段生成的，AO则是执行阶段已VO为基准生成的。\\n// AO相比较VO而言，多了arguments、形参等属于函数特征的变量(此处暂无法确定，网上查询AO与VO解释不唯一)\\na(AO) = {\\n    arguments: {\\n        0: [b],\\n        length: 1,\\n        callee: a\\n    }\\n    b: undefined\\n}</span></code></pre>\\n<p>最终，上述代码实际执行形式为：</p>\\n<pre><code class=\\\"hljs js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">a</span>(<span class=\\\"hljs-params\\\">b</span>) </span>{\\n  <span class=\\\"hljs-built_in\\\">console</span>.log(b) <span class=\\\"hljs-comment\\\">// 输出b的形参值</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> b = <span class=\\\"hljs-number\\\">20</span>;\\n  <span class=\\\"hljs-built_in\\\">console</span>.log(b) <span class=\\\"hljs-comment\\\">// 输出20</span>\\n}\\n<span class=\\\"hljs-keyword\\\">var</span> c = <span class=\\\"hljs-literal\\\">undefined</span>;\\n\\n<span class=\\\"hljs-built_in\\\">console</span>.log(a);  <span class=\\\"hljs-comment\\\">// 输出a方法</span>\\n<span class=\\\"hljs-built_in\\\">console</span>.log(c);  <span class=\\\"hljs-comment\\\">// 输出undefined</span>\\n\\nc = a;\\na = <span class=\\\"hljs-number\\\">10</span>;\\n\\n<span class=\\\"hljs-built_in\\\">console</span>.log(a);  <span class=\\\"hljs-comment\\\">// 输出10</span>\\nc(<span class=\\\"hljs-number\\\">5</span>)</code></pre>\\n<p>参考链接：<a href=\\\"http://www.cnblogs.com/TomXu/archive/2012/01/16/2309728.html\\\">变量对象</a></p>\\n</div>\";\n// Exports\nmodule.exports = code;\n\n//# sourceURL=webpack:///./sources/javascript/%E6%89%A7%E8%A1%8C%E4%B8%8A%E4%B8%8B%E6%96%87%E4%B8%8E%E5%8F%98%E9%87%8F%E6%8F%90%E5%8D%87.md?");

